import React, { Children } from "react";

const btLinkBranco = props => {
  var varValue = props.value;
  var varHref = props.href;

    return (
      // Botão do formulário Meus Documentos.
      <div>
        <a className="btLinkBranco" href={varHref}>
          {varValue}
        </a>
        {/* margin-top: 20px;
              padding: 0;
              margin: 0px;
              margin-top : 20px;
              padding: 10px;
              cursor: pointer;
              border-radius: 8px; */}
        <style jsx>{`
          .btLinkBranco {
            font-family: oiTextRegular, sans-serif;
            background-color: #ffffff;
            border-radius: 8px;
            color: #222222;
            display: block;
            font-size: 1rem; /*16px*/
            height: 3.42857143rem;
            text-align: center;
            width: 300px;
            text-decoration: none;
            border: solid 1px #dbdbdb;
            cursor: pointer;
            outline: 0;
            margin: 0;
            padding: 1.2rem;
            box-sizing: border-box;
            font-style: normal;
            transition: 0.5s;
            -webkit-box-shadow: 2px 2px 20px rgba(1, 1, 1, 0.17);
            -moz-box-shadow: 2px 2px 20px rgba(1, 1, 1, 0.17);
            box-shadow: 2px 2px 20px rgba(1, 1, 1, 0.17);
          }
          .btLinkBranco:hover {
            -webkit-box-shadow: 1px 1px 10px rgba(1, 1, 1, 0.47);
            -moz-box-shadow: 1px 1px 10px rgba(1, 1, 1, 0.47);
            box-shadow: 1px 1px 10px rgba(1, 1, 1, 0.47);
          }
        `}</style>
      </div>
    );

};
export default btLinkBranco;
